/*Table structure for table `mes_plan_assignment_copy` */

DROP TABLE IF EXISTS `mes_plan_assignment_copy`;

CREATE TABLE `mes_plan_assignment_copy` (
  `erp_bill_no` varchar(32) DEFAULT NULL,
  `task_bill_no` varchar(30) DEFAULT NULL,
  `deliver_terms` varchar(200) DEFAULT NULL,
  `package_terms` varchar(200) DEFAULT NULL,
  `mark` varchar(200) DEFAULT NULL,
  `quality_require` varchar(200) DEFAULT NULL,
  `id` varchar(32) NOT NULL,
  `create_time` datetime DEFAULT NULL,
  `update_time` datetime DEFAULT NULL,
  `remarks` varchar(200) DEFAULT NULL,
  PRIMARY KEY (`id`),
  UNIQUE KEY `mesPlanAssignment_index2` (`erp_bill_no`) USING BTREE,
  KEY `idx_mes_plan_assignment_lookup` (`erp_bill_no`,`task_bill_no`) USING BTREE
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

/*Data for the table `mes_plan_assignment_copy` */

/*Table structure for table `mes_plan_bom` */

DROP TABLE IF EXISTS `mes_plan_bom`;

CREATE TABLE `mes_plan_bom` (
  `erp_bill_no` varchar(64) DEFAULT NULL COMMENT '生产订单号',
  `raw_goods_id` varchar(64) DEFAULT NULL COMMENT '原材料ID',
  `raw_goods_name` varchar(128) DEFAULT NULL COMMENT '原材料名称',
  `suplier_id` varchar(64) DEFAULT NULL COMMENT '厂家',
  `spec` varchar(64) DEFAULT NULL COMMENT '规格',
  `unit_qty` decimal(12,2) DEFAULT NULL COMMENT '单位用量',
  `order_qty` decimal(12,2) DEFAULT NULL COMMENT '订单所需总量',
  `unit` varchar(64) DEFAULT NULL COMMENT '单位',
  `id` varchar(64) NOT NULL,
  `create_user` varchar(64) DEFAULT NULL,
  `create_time` datetime DEFAULT NULL,
  `update_user` varchar(64) DEFAULT NULL,
  `update_time` datetime DEFAULT NULL,
  `remarks` varchar(2000) DEFAULT NULL,
  `raw_goods_type` varchar(64) DEFAULT NULL COMMENT '物料属性',
  `batch_no` varchar(64) DEFAULT NULL COMMENT '批号',
  `batchProp1` varchar(64) DEFAULT NULL COMMENT '管头,批次属性1',
  `batchProp2` varchar(64) DEFAULT NULL,
  `unit_code` varchar(64) DEFAULT NULL COMMENT '单位编码',
  PRIMARY KEY (`id`),
  UNIQUE KEY `uk_plan_bom` (`erp_bill_no`,`raw_goods_id`) USING BTREE
