/*Table structure for table `mes_plan_bom_copy` */

DROP TABLE IF EXISTS `mes_plan_bom_copy`;

CREATE TABLE `mes_plan_bom_copy` (
  `erp_bill_no` varchar(64) DEFAULT NULL COMMENT '生产订单号',
  `raw_goods_id` varchar(64) DEFAULT NULL COMMENT '原材料ID',
  `raw_goods_name` varchar(128) DEFAULT NULL COMMENT '原材料名称',
  `suplier_id` varchar(64) DEFAULT NULL COMMENT '厂家',
  `spec` varchar(64) DEFAULT NULL COMMENT '规格',
  `unit_qty` decimal(12,2) DEFAULT NULL COMMENT '单位用量',
  `order_qty` decimal(12,2) DEFAULT NULL COMMENT '订单所需总量',
  `unit` varchar(64) DEFAULT NULL COMMENT '单位',
  `id` varchar(64) NOT NULL,
  `create_user` varchar(64) DEFAULT NULL,
  `create_time` datetime DEFAULT NULL,
  `update_user` varchar(64) DEFAULT NULL,
  `update_time` datetime DEFAULT NULL,
  `remarks` varchar(2000) DEFAULT NULL,
  `raw_goods_type` varchar(64) DEFAULT NULL COMMENT '物料属性',
  `batch_no` varchar(64) DEFAULT NULL COMMENT '批号',
  `batchProp1` varchar(64) DEFAULT NULL COMMENT '管头,批次属性1',
  `batchProp2` varchar(64) DEFAULT NULL,
  `unit_code` varchar(64) DEFAULT NULL COMMENT '单位编码',
  PRIMARY KEY (`id`),
  UNIQUE KEY `uk_plan_bom` (`erp_bill_no`,`raw_goods_id`) USING BTREE
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

/*Data for the table `mes_plan_bom_copy` */

/*Table structure for table `mes_plan_device` */

DROP TABLE IF EXISTS `mes_plan_device`;

CREATE TABLE `mes_plan_device` (
  `id` varchar(64) NOT NULL,
  `dispatch_status` varchar(10) DEFAULT NULL COMMENT '调度状态',
  `plan_begin_date` datetime DEFAULT NULL COMMENT '计划开始日期',
  `plan_end_date` datetime DEFAULT NULL COMMENT '计划结束日期',
  `src_bill_no` varchar(64) DEFAULT NULL COMMENT '上级单号',
  `create_user` varchar(64) DEFAULT NULL,
  `create_time` datetime DEFAULT NULL,
  `update_user` varchar(64) DEFAULT NULL,
  `update_time` datetime DEFAULT NULL,
  `remarks` varchar(255) DEFAULT NULL,
  `del_flag` char(1) DEFAULT NULL,
  `device_require` varchar(4000) DEFAULT NULL COMMENT '厂级说明',
  `bill_no` varchar(64) NOT NULL COMMENT '单号',
  `work_center_qty` decimal(12,2) DEFAULT NULL COMMENT '工作中心数量',
  `finish_qty` double(12,2) DEFAULT NULL COMMENT '完工数量',
  `device_id` varchar(64) DEFAULT NULL COMMENT '设备编号',
  `schedule_status` varchar(10) DEFAULT NULL COMMENT '排程状态',
  `erp_bill_no` varchar(64) NOT NULL COMMENT '订单号',
  `real_begin_date` datetime DEFAULT NULL COMMENT '排程开始日期',
  `real_end_date` datetime DEFAULT NULL COMMENT '排程结束日期',
  `is_chg_goods` char(1) DEFAULT '0' COMMENT '是否换产品',
  `material_use_status` varchar(10) DEFAULT NULL COMMENT '物料状态',
  `no_technic` varchar(2000) DEFAULT NULL COMMENT '跳过的工序',
  `device_name` varchar(256) DEFAULT NULL COMMENT '设备名称',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

