/*Table structure for table `mes_plan_device_day_copy` */

DROP TABLE IF EXISTS `mes_plan_device_day_copy`;

CREATE TABLE `mes_plan_device_day_copy` (
  `id` varchar(64) NOT NULL,
  `workcenter_id` varchar(64) NOT NULL COMMENT '工作中心',
  `device_id` varchar(64) NOT NULL COMMENT '设备id',
  `goods_id` varchar(64) DEFAULT NULL COMMENT '半成品',
  `create_user` varchar(64) DEFAULT NULL,
  `create_time` datetime DEFAULT NULL,
  `update_user` varchar(64) DEFAULT NULL,
  `update_time` datetime DEFAULT NULL,
  `remarks` varchar(3000) DEFAULT NULL,
  `del_flag` int(11) DEFAULT '0',
  `work_date` date NOT NULL COMMENT '排班日期',
  `schedule_status` varchar(10) DEFAULT NULL COMMENT '排班状态',
  `is_chg_goods` varchar(10) NOT NULL COMMENT '是否换产品弃用',
  PRIMARY KEY (`id`),
  UNIQUE KEY `uk_device_day` (`workcenter_id`,`device_id`,`work_date`) USING BTREE
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

/*Data for the table `mes_plan_device_day_copy` */

/*Table structure for table `mes_plan_device_schedule_head` */

DROP TABLE IF EXISTS `mes_plan_device_schedule_head`;

CREATE TABLE `mes_plan_device_schedule_head` (
  `id` varchar(64) NOT NULL,
  `sheetid` varchar(64) DEFAULT NULL,
  `work_room` varchar(64) DEFAULT NULL,
  `work_center_id` varchar(64) DEFAULT NULL,
  `remark` varchar(200) DEFAULT NULL,
  `create_user` varchar(64) DEFAULT NULL,
  `create_time` datetime DEFAULT NULL,
  `update_user` varchar(64) DEFAULT NULL,
  `udpate_time` datetime DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

/*Data for the table `mes_plan_device_schedule_head` */

/*Table structure for table `mes_plan_dispatch_bom` */

DROP TABLE IF EXISTS `mes_plan_dispatch_bom`;

CREATE TABLE `mes_plan_dispatch_bom` (
  `id` varchar(64) NOT NULL,
  `sheet_id` varchar(64) NOT NULL,
  `erp_bill_no` varchar(64) NOT NULL,
  `batch_no` varchar(64) DEFAULT NULL COMMENT '批次',
  `create_time` datetime DEFAULT NULL,
  `create_user` varchar(64) DEFAULT NULL,
  `update_time` datetime DEFAULT NULL,
  `update_user` varchar(664) DEFAULT NULL,
  `remarks` varchar(2000) DEFAULT NULL,
  `batch_prop1` varchar(256) DEFAULT NULL COMMENT '管头,批次属性1',
  `batch_prop2` varchar(256) DEFAULT NULL COMMENT '批次属性2',
  `batch_prop3` varchar(256) DEFAULT NULL COMMENT '批次属性3',
  `raw_goods_id` varchar(64) DEFAULT NULL,
  PRIMARY KEY (`id`),
  UNIQUE KEY `uk_dispatch_bom` (`sheet_id`,`erp_bill_no`,`raw_goods_id`) USING BTREE
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4;

