/*Table structure for table `mes_plan_dispatch_det_copy` */

DROP TABLE IF EXISTS `mes_plan_dispatch_det_copy`;

CREATE TABLE `mes_plan_dispatch_det_copy` (
  `id` varchar(64) NOT NULL,
  `device_qty` int(11) DEFAULT NULL COMMENT '设备数量',
  `device_change_qty` int(11) DEFAULT NULL COMMENT '换产品设备数量',
  `dispatch_qty` decimal(12,2) DEFAULT NULL COMMENT '调度数量',
  `workcenter_id` varchar(10) DEFAULT NULL COMMENT '工作中心',
  `dispatch_status` varchar(10) DEFAULT NULL COMMENT '下发状态',
  `plan_begin_date` datetime DEFAULT NULL COMMENT '开始日期',
  `plan_end_date` datetime DEFAULT NULL COMMENT '结束日期',
  `src_bill_no` varchar(64) DEFAULT NULL COMMENT '上级单号',
  `create_user` varchar(64) DEFAULT NULL,
  `create_time` datetime DEFAULT NULL,
  `update_user` varchar(64) DEFAULT NULL,
  `update_time` datetime DEFAULT NULL,
  `remarks` varchar(255) DEFAULT NULL,
  `del_flag` char(1) DEFAULT NULL,
  `device_change_goods_id` varchar(64) DEFAULT NULL COMMENT '换产品的产品编码',
  `device_require` varchar(4000) DEFAULT NULL COMMENT '要求',
  `sheet_id` varchar(64) DEFAULT NULL COMMENT '单据编号',
  `bill_no` varchar(64) DEFAULT NULL COMMENT '下发单号',
  `work_center_qty` decimal(12,2) DEFAULT NULL COMMENT '已发下数量',
  `finish_qty` decimal(12,2) DEFAULT NULL COMMENT '完工数量',
  `technic_line_id` varchar(64) DEFAULT NULL,
  `capacity_input` decimal(12,2) DEFAULT NULL COMMENT '产能',
  `arrange_group` varchar(64) DEFAULT NULL COMMENT '子工序',
  `shift_id` varchar(64) DEFAULT NULL COMMENT '班次,整理车间用',
  `shift_style` varchar(64) DEFAULT NULL COMMENT '班别,整理车间用',
  `arrange_unit_rate` decimal(12,4) DEFAULT NULL COMMENT '整理车间单位',
  `shift_begin_time` varchar(10) DEFAULT NULL COMMENT '开始时间',
  `shift_end_time` varchar(10) DEFAULT NULL COMMENT '结束时间',
  `dispatch_qty_package` decimal(12,2) DEFAULT NULL COMMENT '整理车间匹数量',
  PRIMARY KEY (`id`),
  UNIQUE KEY `uk_dispatch_det` (`bill_no`) USING BTREE
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

/*Data for the table `mes_plan_dispatch_det_copy` */

/*Table structure for table `mes_plan_dispatch_head` */

DROP TABLE IF EXISTS `mes_plan_dispatch_head`;

CREATE TABLE `mes_plan_dispatch_head` (
  `id` varchar(64) NOT NULL,
  `sheet_id` varchar(64) NOT NULL COMMENT '单据编号',
  `create_user` varchar(64) DEFAULT NULL,
  `create_time` datetime DEFAULT NULL,
  `update_user` varchar(64) DEFAULT NULL,
  `update_time` datetime DEFAULT NULL,
  `remarks` varchar(255) DEFAULT NULL,
  `del_flag` char(1) DEFAULT '0',
  `erp_bill_no` varchar(64) NOT NULL COMMENT '订单号',
  `dispatch_Qty_Sum` decimal(14,2) DEFAULT NULL COMMENT '调度数量总和',
  `sheet_status` varchar(10) DEFAULT NULL COMMENT '单据状态',
  `create_user_name` varchar(64) DEFAULT NULL,
  `update_user_name` varchar(64) DEFAULT NULL,
  PRIMARY KEY (`id`),
  UNIQUE KEY `uk_dispatch_head` (`sheet_id`) USING BTREE
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

