  PRIMARY KEY (`id`),
  UNIQUE KEY `uk_mes_plan_month` (`erp_bill_no`) USING BTREE
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_bin COMMENT='业务数据表';

