/*Table structure for table `mes_plan_month_copy` */

DROP TABLE IF EXISTS `mes_plan_month_copy`;

CREATE TABLE `mes_plan_month_copy` (
  `id` varchar(64) COLLATE utf8_bin NOT NULL COMMENT '编号',
  `erp_bill_no` varchar(64) COLLATE utf8_bin NOT NULL COMMENT '订单编号',
  `plan_status` varchar(10) COLLATE utf8_bin NOT NULL COMMENT '订单状态',
  `goods_id` varchar(32) COLLATE utf8_bin NOT NULL COMMENT '产品编号',
  `goods_cat` varchar(14) COLLATE utf8_bin DEFAULT NULL COMMENT '备用',
  `customer_id` varchar(32) COLLATE utf8_bin DEFAULT NULL COMMENT '客户编码',
  `plan_begin_date` datetime NOT NULL COMMENT '计划开始日期',
  `plan_end_date` datetime NOT NULL COMMENT '计划结束日期',
  `bill_type` varchar(50) COLLATE utf8_bin NOT NULL COMMENT '订单类型',
  `qty` decimal(12,2) NOT NULL COMMENT '订单数量',
  `workshop_id` varchar(10) COLLATE utf8_bin DEFAULT NULL COMMENT '生产车间',
  `contract_id` varchar(64) COLLATE utf8_bin DEFAULT NULL COMMENT '合同号',
  `src_erp_bill_no` varchar(64) COLLATE utf8_bin DEFAULT NULL COMMENT '源单号',
  `create_user` varchar(64) COLLATE utf8_bin DEFAULT NULL COMMENT '创建者',
  `create_time` datetime DEFAULT NULL COMMENT '创建时间',
  `update_user` varchar(64) COLLATE utf8_bin DEFAULT NULL COMMENT '更新者',
  `update_time` datetime DEFAULT NULL COMMENT '更新时间',
  `remarks` varchar(255) COLLATE utf8_bin DEFAULT NULL COMMENT '备注信息',
  `del_flag` char(1) COLLATE utf8_bin NOT NULL DEFAULT '0' COMMENT '删除标记',
  `dispatch_qty` decimal(12,2) DEFAULT NULL COMMENT '已调度数量',
  `finish_Qty` decimal(12,2) DEFAULT NULL COMMENT '完工数量',
  `technic_line_id` varchar(64) COLLATE utf8_bin DEFAULT NULL COMMENT '备用',
  `qty_unit` varchar(32) COLLATE utf8_bin DEFAULT NULL COMMENT '数量单位',
  `domain_id` varchar(64) COLLATE utf8_bin DEFAULT NULL COMMENT '域',
  `quality_require` varchar(2000) COLLATE utf8_bin DEFAULT NULL,
  `package_require` varchar(2000) COLLATE utf8_bin DEFAULT NULL,
  `goods_name` varchar(128) COLLATE utf8_bin DEFAULT NULL COMMENT '品名',
  `qty_unit_code` varchar(128) COLLATE utf8_bin DEFAULT NULL COMMENT '数量单位编码',
  PRIMARY KEY (`id`),
  UNIQUE KEY `uk_mes_plan_month` (`erp_bill_no`) USING BTREE
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_bin COMMENT='业务数据表';

/*Data for the table `mes_plan_month_copy` */

/*Table structure for table `mes_plan_schedule` */

DROP TABLE IF EXISTS `mes_plan_schedule`;

CREATE TABLE `mes_plan_schedule` (
  `id` varchar(64) NOT NULL,
  `sheet_id` varchar(64) NOT NULL COMMENT '单号',
  `workshop_id` varchar(64) NOT NULL COMMENT '车间',
