/*Table structure for table `mes_plan_shift_head` */

DROP TABLE IF EXISTS `mes_plan_shift_head`;

CREATE TABLE `mes_plan_shift_head` (
  `id` varchar(64) NOT NULL,
  `sheet_id` varchar(64) NOT NULL,
  `workshop_id` varchar(64) NOT NULL,
  `shift_id` varchar(32) NOT NULL,
  `shift_date` date NOT NULL,
  `shift_user` varchar(64) DEFAULT NULL,
  `remarks` varchar(2000) DEFAULT NULL,
  `create_user` varchar(64) DEFAULT NULL,
  `create_time` datetime DEFAULT NULL,
  `update_user` varchar(64) DEFAULT NULL,
  `update_time` datetime DEFAULT NULL,
  `shift_qty_sum` decimal(10,2) DEFAULT NULL,
  `finish_qty_sum` decimal(10,2) DEFAULT NULL,
  `sheet_status` varchar(10) DEFAULT NULL,
  `shift_style` varchar(64) DEFAULT NULL,
  `workcenter_id` varchar(64) NOT NULL,
  `shift_user_name` varchar(64) DEFAULT NULL,
  `create_user_name` varchar(64) DEFAULT NULL,
  `update_user_name` varchar(64) DEFAULT NULL,
  PRIMARY KEY (`id`),
  UNIQUE KEY `UK_shift_head` (`sheet_id`) USING BTREE,
  UNIQUE KEY `uk_shift_head2` (`workshop_id`,`shift_id`,`shift_date`,`workcenter_id`) USING BTREE
