/*Table structure for table `mes_plan_shift_user` */

DROP TABLE IF EXISTS `mes_plan_shift_user`;

CREATE TABLE `mes_plan_shift_user` (
  `id` varchar(64) NOT NULL,
  `sheet_id` varchar(64) NOT NULL COMMENT '单号',
  `technic_id` varchar(64) NOT NULL COMMENT '子工序',
  `qty` decimal(10,2) DEFAULT NULL COMMENT '数量',
  `technic_begin_date` varchar(32) DEFAULT NULL,
  `technic_end_date` varchar(32) DEFAULT NULL,
  `technic_user` varchar(2000) DEFAULT NULL,
  `remarks` varchar(2000) DEFAULT NULL,
  `create_user` varchar(64) DEFAULT NULL,
  `create_time` datetime DEFAULT NULL,
  `update_user` varchar(64) DEFAULT NULL,
  `update_time` datetime DEFAULT NULL,
  `technic_unit` varchar(10) DEFAULT NULL,
  `src_bill_no` varchar(64) DEFAULT NULL COMMENT '上级单号',
  `worktype_id` varchar(64) DEFAULT NULL COMMENT '工种',
  `device_sub_id` varchar(64) DEFAULT NULL COMMENT '子设备',
  `task_status` varchar(64) DEFAULT NULL COMMENT '任务状态',
  `p_technic_id` varchar(64) NOT NULL COMMENT '父级工序代码',
  `p_technic_name` varchar(64) DEFAULT NULL COMMENT '父级工序名称',
  `technic_name` varchar(64) DEFAULT NULL COMMENT '子工序名称',
  `task_user` varchar(64) DEFAULT NULL COMMENT '领任务人',
  `task_time` datetime DEFAULT NULL COMMENT '领任务时间',
  PRIMARY KEY (`id`),
  UNIQUE KEY `uk_shift_user` (`sheet_id`,`technic_id`,`src_bill_no`,`worktype_id`) USING BTREE
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

