/*Table structure for table `mes_plan_shift_worker` */

DROP TABLE IF EXISTS `mes_plan_shift_worker`;

CREATE TABLE `mes_plan_shift_worker` (
  `id` varchar(64) NOT NULL,
  `user_id` varchar(64) DEFAULT NULL COMMENT '工号',
  `worktype_id` varchar(64) DEFAULT NULL COMMENT '工种',
  `work_status` varchar(10) DEFAULT NULL COMMENT '是否到岗1=到岗0=缺勤',
  `remarks` varchar(2000) DEFAULT NULL,
  `create_user` varchar(64) DEFAULT NULL,
  `create_time` datetime DEFAULT NULL,
  `update_user` varchar(64) DEFAULT NULL,
  `update_time` datetime DEFAULT NULL,
  `sheet_id` varchar(64) NOT NULL COMMENT '单号',
  `user_name` varchar(64) DEFAULT NULL COMMENT '姓名',
