/*Table structure for table `mes_plan_technic` */

DROP TABLE IF EXISTS `mes_plan_technic`;

CREATE TABLE `mes_plan_technic` (
  `erp_bill_no` varchar(64) NOT NULL,
  `technic_id` varchar(64) NOT NULL COMMENT '工序编码',
  `technic_name` varchar(128) DEFAULT NULL COMMENT '工序名称',
  `technic_index` int(11) DEFAULT NULL COMMENT '工序序号',
  `technic_desc` varchar(2000) DEFAULT NULL COMMENT '工序描述',
  `workcenter_id` varchar(64) DEFAULT NULL COMMENT '工作中心',
  `worktype_id` varchar(64) DEFAULT NULL COMMENT '工种，多个时默认一个。',
  `worktype_std_time` decimal(12,2) DEFAULT NULL COMMENT '标准工时',
  `worktype_user_time` decimal(12,2) DEFAULT NULL COMMENT '人力工时',
  `id` varchar(64) NOT NULL,
  `create_user` varchar(64) DEFAULT NULL,
  `create_time` datetime DEFAULT NULL,
  `update_user` varchar(64) DEFAULT NULL,
  `update_time` datetime DEFAULT NULL,
  `remarks` varchar(3000) DEFAULT NULL,
  PRIMARY KEY (`id`),
  UNIQUE KEY `uk_plan_technic` (`erp_bill_no`,`technic_id`) USING BTREE
