CREATE TABLE `mes_plan_temp_task` (
  `id` varchar(64) NOT NULL,
  `sheet_id` varchar(64) NOT NULL,
  `plan_begin_date` datetime DEFAULT NULL COMMENT '开始时间',
  `plan_end_date` datetime DEFAULT NULL COMMENT '结束时间',
