/* Procedure structure for procedure `prc_event_ synchro_emtype` */

/*!50003 DROP PROCEDURE IF EXISTS  `prc_event_ synchro_emtype` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`admin`@`%` PROCEDURE `prc_event_ synchro_emtype`()
BEGIN
	DECLARE v_count INT default 0;
	#Routine body goes here...
	-- 同步设备分类信息
	  -- 根据设备分类编码新增不存在的数据
	INSERT INTO em_type(id,typecode,typename,parenttype)
	SELECT fun_em_nextval('TYPE'), a.typecode,a.typename,
				(CASE WHEN a.parent='' THEN '#' ELSE (SELECT c.typecode from mdm_em_type c WHERE c.id=a.parent) END )  
	FROM mdm_em_type a
	WHERE NOT EXISTS (SELECT 1 FROM em_type b WHERE b.typecode=a.typecode);

	SELECT count(1) into v_count FROM em_type WHERE typecode='S999999';
	
	IF v_count = 0 THEN
		INSERT INTO em_type(id,typecode,typename,parenttype) 
					SELECT fun_em_nextval('TYPE'),'S999999','其他',typecode 
					FROM em_type 
					WHERE parenttype='#' 
					LIMIT 1;
	END IF;
												
END */$$
DELIMITER ;

