/*!50003 CREATE DEFINER=`admin`@`%` PROCEDURE `prc_event_ synchro_equipment`()
BEGIN
	#Routine body goes here...
	-- 同步设备信息
	  -- 根据设备编码新增不存在的数据
	INSERT INTO em_equipment(id,emcode,typecode,emname,source,manufactur,dept,sn,useryear,org)
							 SELECT fun_em_nextval('EQUIPMENT'),emcode,
											(SELECT type.typecode FROM em_type type where type.id = a.typecode) typecode,
											emname,source,manufactur,
